
List places = [{"details":"Humayun's tomb is the tomb of the Mughal Emperor Humayun in Delhi, India. The tomb was commissioned by Humayun's first wife and chief consort, Empress Bega Begum, in 1558, and designed by Mirak Mirza Ghiyas and his son, Sayyid Muhammad, Persian architects chosen by her.","img":"https://delhitourism.travel/images/places-to-visit/headers/humayun-s-tomb-delhi-entry-fee-timings-holidays-reviews-header.jpg","imgSet":["https://delhitourism.travel/images/places-to-visit/headers/humayun-s-tomb-delhi-entry-fee-timings-holidays-reviews-header.jpg","https://2.bp.blogspot.com/-ZN-sEU47bpc/WPWzeT9Q-iI/AAAAAAAASTw/zJ04sLvlchcg_pNgp2iShKzxV0XJikIbQCLcB/s1600/Humanyuns-Tomb-Delhi.jpg","https://photos.smugmug.com/Asia/India/Delhi-2016/i-MnPGXwC/0/X3/DSC01190-X3.jpg","https://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Humayun_Tomb%2C_Delhi%2C_running_fountain.jpg/1200px-Humayun_Tomb%2C_Delhi%2C_running_fountain.jpg","https://upload.wikimedia.org/wikipedia/commons/7/75/Delhi%2C_Humayun's_Tomb_(9710410947).jpg","https://thementalclub.com/wp-content/uploads/2017/11/89563-Humayuns-Tomb.jpg","https://res.cloudinary.com/dk-find-out/image/upload/q_80,w_1920,f_auto/DCTM_Penguin_UK_DK_AL345768_mxdsvn.jpg","https://upload.wikimedia.org/wikipedia/commons/thumb/c/c5/Humayun's_Tomb%2C_Delhi%2C_India_2019.jpg/1200px-Humayun's_Tomb%2C_Delhi%2C_India_2019.jpg","https://upload.wikimedia.org/wikipedia/commons/3/38/Humayun's_tomb_04.JPG","https://upload.wikimedia.org/wikipedia/commons/5/50/Humayun's_Tomb%2C_Delhi%2C_India_2.jpg","https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/Humayunstomb1.jpg/1200px-Humayunstomb1.jpg","https://upload.wikimedia.org/wikipedia/commons/1/1d/Humayun's_Tomb_from_the_entrance%2C_Delhi.jpg","https://www.tripsavvy.com/thmb/H6JUCr3teDWfAg_eELDibLfPr3g=/2121x1414/filters:fill(auto,1)/GettyImages-536567385-5bf67b8646e0fb00261bde01.jpg","https://www.askideas.com/media/36/Adorable-Image-Of-Humayuns-Tomb.jpg","https://www.kuoni.co.uk/upload/1170x398/pois/india/humayuns-tomb.jpg","https://upload.wikimedia.org/wikipedia/commons/thumb/e/ed/Humayun's_Tomb_Monument.jpg/1200px-Humayun's_Tomb_Monument.jpg","https://assetsds.cdnedge.bluemix.net/sites/default/files/styles/very_big_1/public/feature/images/3_19.jpg?itok=W9Td1oQI","https://upload.wikimedia.org/wikipedia/commons/e/eb/Humayun's_Tomb%2C_seen_from_the_Char_Bagh_Garden..JPG","https://i2.wp.com/nextbiteoflife.com/wp-content/uploads/2015/11/humayuns-tomb-delhi1.jpg?ssl=1","https://upload.wikimedia.org/wikipedia/commons/thumb/8/89/Humayun%27s_Tomb%2C_with_the_Barber%27s_Tomb_in_the_foreground%2C_Delhi%2C_1858_photograph.jpg/1280px-Humayun%27s_Tomb%2C_with_the_Barber%27s_Tomb_in_the_foreground%2C_Delhi%2C_1858_photograph.jpg","https://holidify.com/images/attr_wiki/compressed/attr_wiki_516.jpg","https://thementalclub.com/wp-content/uploads/2017/11/Humayuns_Tomb_-_Inside_Isa_Khan_Tomb_1.jpg"],"location":"Mathura Road Opposite, Hazrat Nizamuddin Aulia Dargah, Mathura Rd, Nizamuddin, Nizamuddin East, New Delhi, Delhi 110013","name":"Humayun\u2019s Tomb"},{"details":"Gol Gumbaz is the tomb of king Muhammad Adil Shah, Adil Shah Dynasty. Construction of the tomb, located in Bijapur, Karnataka, India, was started in 1626 and completed in 1656. The name is based on \"Gol Gumbadh\" derived from \"Gola Gummata\" meaning \"circular dome\". It follows the style of Indo-Islamic architecture.","img":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/GolGumbaz2.jpg/1200px-GolGumbaz2.jpg","imgSet":["https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/GolGumbaz2.jpg/1200px-GolGumbaz2.jpg","https://upload.wikimedia.org/wikipedia/commons/1/19/Gol_Gumbaz_Front.JPG","https://www.gosahin.com/upload/destinations/1521719927_Gol-Gumbaz1.jpg","https://upload.wikimedia.org/wikipedia/commons/9/9b/Gol_Gumbaz_-6%2C_Bijapur%2C_Karnataka.jpg","https://upload.wikimedia.org/wikipedia/commons/b/b6/Gol_Gumbaz.jpg","https://www.orientrailjourneys.com/blog/wp-content/uploads/2