 are of a single storey while the larger ones are two storied.","img":"https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Qutb_Shahi_Tomb_5.jpg/1200px-Qutb_Shahi_Tomb_5.jpg","imgSet":["https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Qutb_Shahi_Tomb_5.jpg/1200px-Qutb_Shahi_Tomb_5.jpg","https://media-cdn.tripadvisor.com/media/photo-s/03/41/f0/4e/qutb-shahi-tombs.jpg","https://image.arrivalguides.com/1230x800/07/c0a2c7564b85ca93c09e21fa1ded3e3d.jpg","https://upload.wikimedia.org/wikipedia/commons/thumb/9/93/Tomb_of_Hayath_Bakshi_Begum_01.jpg/1200px-Tomb_of_Hayath_Bakshi_Begum_01.jpg","https://cdn.telanganatoday.com/wp-content/uploads/2017/12/071951DSC_0250-1024x701.jpg","https://media2.trover.com/T/5666e0a17eb4f4307b0fd64f/fixedw_large_4x.jpg","https://thumbs.dreamstime.com/z/qutb-shahi-tombs-hyderabad-contain-mosques-built-various-kings-dynasty-152281698.jpg","https://thumbs.dreamstime.com/b/qutb-shahi-tombs-hyderabad-26224359.jpg","https://media.gettyimages.com/photos/the-qutb-shahi-tombs-hyderabad-india-picture-id1043041508","https://caravandaily.com/portal/wp-content/uploads/2018/04/qutub-shahi-tombs.jpg","https://brainfeedmagazine.com/wp-content/uploads/2020/07/106532329_2533088147003934_3133973529848767769_o-600x750.jpg","https://thumbs.dreamstime.com/b/qutb-shahi-tombs-hyderabad-26224499.jpg","https://upload.wikimedia.org/wikipedia/commons/5/58/Tomb_of_Sultan_Muhammad_Qutb_Shah_01.jpg","https://i.pinimg.com/originals/c3/64/d2/c364d20bb706400a0ab25593d6a3f339.jpg","https://upload.wikimedia.org/wikipedia/commons/0/03/Qutb_Shahi_Tombs_-_minarets.jpg","https://i.pinimg.com/originals/b6/1f/07/b61f07fff7cdb07c74baeea6b9daa1cc.jpg","https://i1.wp.com/thegoodlifewithiq.com/wp-content/uploads/2018/04/Qutb-Shahi-tombs-timeline.jpg?ssl=1","https://i.pinimg.com/originals/e2/83/75/e283757b3dd8d5b559a58fa2aa964494.jpg","https://i.pinimg.com/originals/3d/e7/58/3de758c357c0e22f9c4596a2e700bcf4.jpg"],"location":"Qutub Shahi Tombs, Hyderabad, Telangana 500008","name":"Qutb Shahi Tombs"},{"details":"Salasar Balaji is a religious place for the devotees of Lord Hanuman. It is located in Churu district of Rajasthan. Salasar Dham is visited by innumerable Indian devotees throughout the year. Every year big fairs are organized on Chaitra Purnima and Ashwin Purnima.","img":"https://i.ytimg.com/vi/PuXKqUCG3Nw/maxresdefault.jpg","imgSet":["https://i.ytimg.com/vi/PuXKqUCG3Nw/maxresdefault.jpg","https://imgk.timesnownews.com/story/salasar_hanuman_mandir.JPG","https://upload.wikimedia.org/wikipedia/commons/f/fc/Salasar_balaji_02.jpg","https://tyagibusrental.in/wp-content/uploads/2019/07/Shri-Salasar-Balaji-maharaj-1024x768.jpeg","https://static.punjabkesari.in/multimedia/2016_4image_15_29_0693740443.%E0%A4%B8-ll.jpg","https://templetiming.com/wp-content/uploads/2019/12/88-1111x400-1-1024x369.jpg","https://www.templepurohit.com/wp-content/uploads/2015/11/256.jpg","https://www.templepurohit.com/wp-content/uploads/2015/11/166.jpg","https://www.tourmyindia.com/images/salasar-balaji-dham4.jpg","https://i.ytimg.com/vi/wzNn9xtmTGM/maxresdefault.jpg","https://www.tourmyindia.com/images/salasar-balaji-dham2.jpg","https://tyagibusrental.in/wp-content/uploads/2019/07/Delhi-To-Salasar-Balaji-By-Bus-1024x768.jpeg","https://live.staticflickr.com/1773/43774493502_c2e7e8d700_b.jpg","https://p2.hiclipart.com/preview/803/250/523/rama-navami-hindu-god-lord-rama-ramayana-shri-salasar-balaji-dham-mandir-ravana-sita-bhajan-jai-shri-ram-ram-raksha-stotra-png-clipart.jpg","https://c1.klipartz.com/pngpicture/49/161/sticker-png-bhagwan-shri-hanumanji-guru-reamker-shree-salasar-balaji-dham-mandir-hanuman-chalisa-rama-panchamukha-temple-hindu-temple.png","https://temple.yatradham.org/wp-content/uploads/2020/06/salasar-hanuman-temple-300x214.jpg","https://tyagibusrental.in/wp-content/uploads/2019/07/bus-hire-for-salasar-balaji-1024x768.jpeg","https://yt3.ggpht.com/1aHSxm2eSbJCWMAfEJ1Axa_e5CWvUYKSiQLJi5kBTlksrMpAzOSfzrGcxNI66pU_c7EOuJ9lW5CEG0m_=s900-mo-c-c0xfffffff